import './comp.css';

function Comp05(props) {
    const num1 = 3;
    const num2 = 3;
    const num3 = 16;
    const str1 = 'the';
    const str2 = 'book';
    return (
        <div className="comp comp01">
            <h3><span>05</span>implement js into html tags (result of degree)</h3>
            <div>
                <p>result of degree: {num1} ** {num2} = {num1 ** num2}</p>
                <p>result of Math.sqrt (квадратный корень) {num3}: {Math.sqrt(num3)}</p>
                <p>result of str: {str1} + {str2} = {str1 + ' ' + str2}</p>
            </div>
        </div>
    )
}

export default Comp05;
